import React, { Component } from 'react'

export default class InfoCardSkills extends Component {
  render() {


    return (
      <div className="Card infoCard">
        <div className='infoTitle'> <i class="material-icons">card_giftcard</i> Skills Knowledge to Share </div>
        <ul>
            <li>UX/UI</li>
            <li>Graphic Design</li>
            <li>Video Production</li>
            <li>Digital Marketing</li>
        </ul>
      </div>
    )
  }
}
